// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadUniFontData(char *Buffer)
{
    memcpy(Buffer, &UniFontL0[1], UniFontL0[0] << 2);
    Buffer += (UniFontL0[0] << 2);

    memcpy(Buffer, &UniFontL1[1], UniFontL1[0] << 2);
    Buffer += (UniFontL1[0] << 2);

    memcpy(Buffer, &UniFontL2[1], UniFontL2[0] << 2);
    Buffer += (UniFontL2[0] << 2);

    memcpy(Buffer, &UniFontL3[1], UniFontL3[0] << 2);
    Buffer += (UniFontL3[0] << 2);

    memcpy(Buffer, &UniFontL4[1], UniFontL4[0] << 2);
    Buffer += (UniFontL4[0] << 2);

    memcpy(Buffer, &UniFontL5[1], UniFontL5[0] << 2);
    Buffer += (UniFontL5[0] << 2);

    memcpy(Buffer, &UniFontB[1], UniFontB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char UniFontName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillUniFontData(void)
{
    remove(UniFontName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteUniFontData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(UniFontName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, UniFontName)) return "";
    #endif

    if (!(han = fopen(UniFontName, "wb"))) return "";
    if (AutoClean) atexit(KillUniFontData);

    num = fwrite(&UniFontL0[1], 4, UniFontL0[0], han);
    if (num != UniFontL0[0]) {fclose(han); return "";}

    num = fwrite(&UniFontL1[1], 4, UniFontL1[0], han);
    if (num != UniFontL1[0]) {fclose(han); return "";}

    num = fwrite(&UniFontL2[1], 4, UniFontL2[0], han);
    if (num != UniFontL2[0]) {fclose(han); return "";}

    num = fwrite(&UniFontL3[1], 4, UniFontL3[0], han);
    if (num != UniFontL3[0]) {fclose(han); return "";}

    num = fwrite(&UniFontL4[1], 4, UniFontL4[0], han);
    if (num != UniFontL4[0]) {fclose(han); return "";}

    num = fwrite(&UniFontL5[1], 4, UniFontL5[0], han);
    if (num != UniFontL5[0]) {fclose(han); return "";}

    num = fwrite(&UniFontB[1], 1, UniFontB[0], han);
    if (num != UniFontB[0]) {fclose(han); return "";}

    fclose(han);
    return UniFontName;
}

